import { useParams } from "react-router-dom";

const EventDetailsPage = () => {
    const params = useParams();
    return (
        <>
            <h1>Event details</h1>
            <p>this is event number: {params.eventId}</p>
        </>
    )
};

export default EventDetailsPage;
